import React, {useEffect, useState} from 'react';


import fetchStockDataIEX from "../../Utilities/Data/Stocks/StockDataIEX";
import axios from "axios";

export default function DashTile(props) {
    const [counter,setCounter] = useState(0);
    const [price, setPrice] = useState(0);
    var negative = (false);

    /**useEffect(()=>{

        let isMounted = true;
        const intervalId = setInterval(() => {
            async function fetchStockPrice(ticker) {
                let requestString = 'https://sandbox.iexapis.com/stable/stock/' + ticker + '/price?token=Tsk_b7a45cc65e624a55a5688d15eac1b692';
                let myJson = await axios.get(requestString);
                return await myJson.data;
            }

            fetchStockPrice(props.symbol).then(result => setPrice(result));
        },5000);
        return () => {
            clearInterval(intervalId); //This is important
            isMounted = false // Let's us know the component is no longer mounted.
        }
    },[]);**/

    return (
        <div className="px-1 py-1 ">
            <div className="flex flex-row ">
                <div className="px-1 py-1 rounded-md border-2 { negative ? border-red-500 hover:bg-red-400 : border-green-500 hover:bg-green-400 } text-sm font-medium text-white bg-TDBase focus:outline-none focus:text-white focus:bg-gray-700 ">
                    <div className="flex flex-row">
                        <div className=" flex-column">
                            <div className="text-left font-bold">
                                {props.symbol}
                            </div>
                            <div className="text-left font-bold">
                                {price}
                            </div>
                        </div>
                        <div className="p-1 text-right align-text-top font-bold">
                            12%
                        </div>
                    </div>
                </div>

            </div>

            </div>




    );
}

function getPrice(ticker){
    return fetchStockDataIEX(ticker);

}
